import React from 'react';
import "./art.css"
import MyButton from "./MyButton";

function ContactForm(props) {
    const imageSrc = props.imageRoute
    return (
        <div>
            <img src={imageSrc}/>
            <div className={"popUp"}>
                <img src={imageSrc}/>
                <MyButton btnText={"Close"}></MyButton>
            </div>
        </div>
    );
}

export default ContactForm;
